import React, { useState } from 'react';
import { useSelector } from 'react-redux';

import Input from './components/input';

import './App.scss';

const App: React.FC = () => {
    const { data: { count, searchResult } } = useSelector((state: any) => state);
    const [result, getResults] = useState([]);

    const iterate = () => {
        for (var key in searchResult) {
            const obj = searchResult[key];
            getResults(obj);
        }
    }

    return (
        <>
            <header>
                <h1>Pub Med Journal Search</h1>
            </header>
            <div className="form-container">
                <Input id="input" placeholder="search here for journals..." />
            </div>
            <div>
                <h2>{`Count is ${count?.esearchresult?.count}`}</h2>
                {result && result.forEach((el: any) => el.source)}
            </div>
        </>
    );
};


export default App;
